package com.example.testgeekspro.ui.fragment.cars

import android.os.Bundle
import androidx.fragment.app.Fragment
import android.view.LayoutInflater
import android.view.View
import android.view.ViewGroup
import androidx.core.os.bundleOf
import androidx.navigation.fragment.findNavController
import com.example.testgeekspro.R
import com.example.testgeekspro.data.CarModel
import com.example.testgeekspro.databinding.FragmentCarBinding
import com.example.testgeekspro.ui.adapter.CarAdapter
import com.example.testgeekspro.utils.Keys

class CarFragment : Fragment() {

    private val binding by lazy{
        FragmentCarBinding.inflate(layoutInflater)
    }

    private val carList = arrayListOf(
        CarModel(
            "Mercedes",
            "2021",
            "data:image/jpeg;base64,"
        ),
        CarModel(
            "BMW",
            "2006",
            "data:image/jpeg;base64,"
        ),
        CarModel(
            "Porsche",
            "2014",
            "data:image/jpeg;base64,"
        )
    )

    override fun onCreateView(
        inflater: LayoutInflater, container: ViewGroup?,
        savedInstanceState: Bundle?,
    ): View {
        return binding.root
    }

    override fun onViewCreated(view: View, savedInstanceState: Bundle?) {
        super.onViewCreated(view, savedInstanceState)
        initialize()
    }

    private fun initialize() {
        binding.rvCars.adapter = CarAdapter(carList, this::onClick)
    }

    private fun onClick(model: CarModel){
        findNavController().navigate(R.id.detailCarFragment, bundleOf(Keys.KEYS_FOR_CAR to model))

    }
}